import React, { Component } from "react";
import {
    
  Navbar,
  Nav,
  NavDropdown,
  Form,
  FormControl,
  Button,
} from "react-bootstrap";

export default class NavHeader extends Component {
  render() {
    return (
      <div>
        <Navbar bg="lg" expand="xxl">
          <container>
          <div class="container-fluid">
    <a class="navbar-brand" href="#">Sticky top</a>
  </div>
          </container>
        </Navbar>
      </div>
    );
  }
}
